/*Table structure for table `userinsurancemaster` */

DROP TABLE IF EXISTS `userinsurancemaster`;

CREATE TABLE `userinsurancemaster` (
  `uinsuranceId` int(15) NOT NULL auto_increment,
  `uinsuranceTicketId_TicketID` int(15) default NULL,
  `uinsuranceInsuranceId_InsuranceID` int(15) default NULL,
  `uinsuranceBookingId_BookingID` int(15) default NULL,
  `uinsuranceFlightId_FlightID` int(15) default NULL,
  `uinsuranceLoginId_LoginID` int(15) default NULL,
  `uinsuranceActiveStatus` varchar(20) default 'active',
  PRIMARY KEY  (`uinsuranceId`),
  KEY `uinsuranceTicketId_TicketID` (`uinsuranceTicketId_TicketID`),
  KEY `uinsuranceInsuranceId_InsuranceId` (`uinsuranceInsuranceId_InsuranceID`),
  KEY `uinsuranceLoginId_LoginID` (`uinsuranceLoginId_LoginID`),
  KEY `uinsuranceFlightId_FlightID` (`uinsuranceFlightId_FlightID`),
  KEY `uinsuranceBookingId_BookingID` (`uinsuranceBookingId_BookingID`),
  CONSTRAINT `userinsurancemaster_ibfk_1` FOREIGN KEY (`uinsuranceTicketId_TicketID`) REFERENCES `ticketmaster` (`ticketId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `userinsurancemaster_ibfk_2` FOREIGN KEY (`uinsuranceInsuranceId_InsuranceId`) REFERENCES `insurancemaster` (`insuranceId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `userinsurancemaster_ibfk_3` FOREIGN KEY (`uinsuranceLoginId_LoginID`) REFERENCES `loginmaster` (`loginId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `userinsurancemaster_ibfk_4` FOREIGN KEY (`uinsuranceFlightId_FlightID`) REFERENCES `flightmaster` (`flightId`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `userinsurancemaster_ibfk_5` FOREIGN KEY (`uinsuranceBookingId_BookingID`) REFERENCES `bookingmaster` (`bookingId`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

